var Freaq=function(dataset){var size,mean,median,mode,range,sVar,sDeviation,q1,q2,q3,instance={dataset:dataset,size:function(){return instance.dataset.length},summation:function(){return instance.dataset.reduce((function(prev,current){return prev+current}),0)},sort:function(){return quicksort(instance.dataset)},mean:function(){return instance.summation()/instance.size()},median:function(){var nums=instance.sort(),half=Math.floor(instance.size()/2);return instance.size()%2?nums[half]:(nums[half-1]+nums[half])/2},mode:function(){for(var arr=instance.dataset,mode={},max=0,count=0,i=0;i<arr.length;i++){var item=Math.floor(arr[i]);mode[item]?mode[item]++:mode[item]=1,count<mode[item]&&(max=item,count=mode[item])}return max},range:function(){return instance.sort()[instance.dataset.length-1]-instance.sort()[0]},sVar:function(){var m=instance.mean(),sum;return instance.dataset.reduce((function(curr,n){return curr+Math.pow(n-m,2)}),0)/(instance.size()-1)},sDeviation:function(){return Math.sqrt(instance.sVar())},q1:function(){var index=Math.floor((instance.size()+1)/4);return instance.sort()[index]},q2:function(){var index=Math.floor((instance.size()+1)/2);return instance.sort()[index]},q3:function(){var index=Math.floor(3*instance.size()/4);return instance.sort()[index]}};return instance};function quicksort(array){if(array.length<=1)return array;for(var pivot=array[0],left=[],right=[],i=1;i<array.length;i++)array[i]<pivot?left.push(array[i]):right.push(array[i]);return quicksort(left).concat(pivot,quicksort(right))}